import {
  Card,
  CardMedia,
  Container,
  Grid,
  IconButton,
  Paper,
} from "@material-ui/core";
import { Close } from "@material-ui/icons";

const paperStyle = {
  padding: "16px",
  marginTop: "100px",
};

const cardStyle = {
  marginBottom: "48px",
};

const CardMediaStyle = {
  paddingTop: "100%",
};

const NewPopup = (props) => {
  const txt =
    "FOOD TRUCK - GRILLED CHICKEN\n벼락닭꼬치  CHICKEN SKEWERS\n입안에서 터지는 맛! 식도 타고 흐르는 맛!\n\n통인시장에서 줄 서서 먹는다는 효자동 닭꼬치가 커먼그라운드에 새로운 이름으로 찾아왔습니다.\n모짜렐라치즈, 소금구이 등 다양한 맛을 내는 닭꼬치가 준비되어 있습니다.\n\n상상 이상의 사이즈에 맛도, 가격도 상상 이상인 한번 맛보면 바로 단골 손님이 되는 그 맛, <벼락닭꼬치>를 푸드트럭에서 시원한 맥주와 함께 즐길 수 있습니다.\n\nLAST ORDER : 21시 30분";
  return (
    <Container maxWidth="md">
      <Paper style={paperStyle}>
        <div style={{ float: "right" }}>
          <IconButton onClick={props.onClose}>
            <Close />
          </IconButton>
        </div>
        <Grid container spacing={2} justify="center">
          <Grid item xs={12} sm={6}>
            <Card style={cardStyle}>
              <CardMedia
                style={CardMediaStyle}
                image="https://s3.ap-northeast-2.amazonaws.com/images.brandsites/common-ground/uploads/00000000354.png"
                title="벼락닭꼬치"
              />
            </Card>
          </Grid>
          <Grid item xs={12} sm={6}>
            <h1>벼락닭꼬치</h1>
            <span style={{ whiteSpace: "pre-line" }}>{txt}</span>
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default NewPopup;
